#Merges SQL query results with state classification file


def cleanMySQL(SQLPath, cleanPath):
	"""given the path to the mySQL output, remove the newline characters
	to allow for easier parsing"""
	fr = open(SQLPath)
	file = fr.read()
	file.replace("\n", " ")
	file.replace("\t\t", "\t")
	file.replace("\0", "")
	fw = open(cleanPath, 'w')
	fw.write(file)
	return file



def mergeData(SQLpath, statesPath):
	# initializes array that will hold eventid, date, user, compilation boolean
	# and state for each compilation in that order
	fullList = []

	states = open(statesPath)
	with open(SQLpath) as table:
		lines = table.readlines()

	#for each compilation event, get relevant data
	for line in lines:
		splitLine = line.split('\t')
		master_id = splitLine[0].rstrip()
		event_id = splitLine[1].rstrip()
		is_error = splitLine[2].rstrip()
		message = splitLine[3].rstrip()
		created_at = splitLine[4].rstrip()
		data = getState(master_id, statesPath)
		if data != None:
			compiles = data[0]
			state = data[1]

			fullList.append([master_id, event_id, is_error, message, created_at, compiles, state])

	return  fullList


