def getState(masterid, statesPath):
	file = open(statesPath)
	states = file.readlines()
	compiles = ""
	state = ""
	for line in states:
		if masterid in line:
			underscores = 0
			colons = 0
			for x in range(len(line)):
				if line[x] == "_":
					underscores += 1

				# Gets compilation result from file name
				if line[x] == "_" and underscores == 4:
					compiles = line[x+1]

				if line[x] == ':':
					colons += 1

				# Gets state from anaylsis.txt
				# .rstrip() removes whitespace & newline chars
				if line[x] == ":" and colons == 2:
					state = line[x+2:].rstrip()
					break
			break
	if compiles == "":
		return None
	#return the compilation result and state of file with given master event id
	return [compiles, state]



