def categorizeCFS(dic):
	ccfsNum = {}
	ccfsMes = []
	ccfsNum['method'] = 0
	ccfsNum['class'] = 0
	ccfsNum['variable'] = 0
	for key in dic:
		ccfsMes += [key]
		if 'method' in key:
			ccfsNum['method'] += dic[key]
		elif 'class' in key:
			ccfsNum['class'] += dic[key]
		elif 'variable' in key:
			ccfsNum['variable'] += dic[key]
	return ccfsNum, ccfsMes



def getBiggestError(dic):
	""" takes a dictionary and returns the key of the dictionary
	whose value is the largest, as well as its value, as a tuple """
	currentMax = 0
	maxKey = ""
	for x in dic:
		if dic[x] > currentMax and x != 'NULL':
			currentMax = dic[x]
			maxKey = x
	return maxKey, currentMax



def makeSortedList(dic):
	"""takes unsorted dictionary and makes it into a sorted list """
	unsortedlist = []
	for key in dic:
		unsortedlist.append([key, dic[key]])
	return sortHelper(unsortedlist)



def sortHelper(unsortedlist):
	if len(unsortedlist) == 1:
		return unsortedlist
	for x in range(len(unsortedlist)-1):
		if unsortedlist[x] > unsortedlist[x+1]:
			temp = unsortedlist[x]
			unsortedlist[x] = unsortedlist[x+1]
			unsortedlist[x+1] = temp
	return sortHelper(unsortedlist[:-1]) + unsortedlist[-1]







